// Name: Color Master
// ID: SPcolorMaster
// Description: Color Utilities and Color Conversions
// By: SharkPool

// Version 1.3.1

(function (Scratch) {
  "use strict";
  if (!Scratch.extensions.unsandboxed) throw new Error("Color Master must run unsandboxed");

  const menuIconURI =
"data:image/svg+xml;base64,";

  class SPcolorMaster {
    getInfo() {
      return {
        id: "SPcolorMaster",
        name: "Color Master",
        color1: "#025bf5",
        color2: "#2600b3",
        color3: "#1e008c",
        menuIconURI,
        blocks: [
          { blockType: Scratch.BlockType.LABEL, text: "Hexes" },
          {
            opcode: "hexString",
            blockType: Scratch.BlockType.REPORTER,
            text: "hex [COLOR]",
            arguments: {
              COLOR: { type: Scratch.ArgumentType.COLOR, defaultValue: "#ff0000" }
            }
          },
          {
            opcode: "convPen",
            blockType: Scratch.BlockType.REPORTER,
            text: "convert hex [COLOR] to pen-friendly",
            arguments: {
              COLOR: { type: Scratch.ArgumentType.STRING, defaultValue: "#ff0000ff" }
            }
          },
          {
            opcode: "changeHexAtt",
            blockType: Scratch.BlockType.REPORTER,
            text: "set [ATT] of [COLOR] to [NUM]",
            arguments: {
              ATT: { type: Scratch.ArgumentType.STRING, menu: "COLATTS" },
              COLOR: { type: Scratch.ArgumentType.COLOR, defaultValue: "#ff0000" },
              NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 5 }
            }
          },
          {
            opcode: "mergeHex",
            blockType: Scratch.BlockType.REPORTER,
            text: "mix [COLOR] with [COLOR2] by [NUM]%",
            arguments: {
              COLOR: { type: Scratch.ArgumentType.COLOR, defaultValue: "#ff0000" },
              COLOR2: { type: Scratch.ArgumentType.COLOR, defaultValue: "#0000ff" },
              NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 50 }
            }
          },
          {
            opcode: "invertHex",
            blockType: Scratch.BlockType.REPORTER,
            text: "invert [COLOR]",
            arguments: {
              COLOR: { type: Scratch.ArgumentType.COLOR, defaultValue: "#ff0000" }
            }
          },
          {
            opcode: "sameColor",
            blockType: Scratch.BlockType.BOOLEAN,
            text: "does [COLOR] match [COLOR2] with softness [NUM]%",
            arguments: {
              COLOR: { type: Scratch.ArgumentType.COLOR, defaultValue: "#ff0000" },
              COLOR2: { type: Scratch.ArgumentType.COLOR, defaultValue: "#ff6600" },
              NUM: { type: Scratch.ArgumentType.NUMBER, defaultValue: 15 }
            }
          },
          {
            opcode: "randomHex",
            blockType: Scratch.BlockType.REPORTER,
            text: "random [COLOR] color",
            arguments: {
              COLOR: { type: Scratch.ArgumentType.STRING, menu: "COLORS" }
            }
          },
          { blockType: Scratch.BlockType.LABEL, text: "Conversions" },
          {
            opcode: "hex2COL",
            blockType: Scratch.BlockType.REPORTER,
            text: "hex [COLOR] to [COL]",
            arguments: {
              COLOR: { type: Scratch.ArgumentType.COLOR, defaultValue: "#ff0000" },
              COL: { type: Scratch.ArgumentType.STRING, menu: "COLCONV" }
            }
          },
          {
            opcode: "RGB2hex",
            blockType: Scratch.BlockType.REPORTER,
            text: "rgb [COLOR] to hex",
            arguments: {
              COLOR: { type: Scratch.ArgumentType.STRING, defaultValue: `{"r":255, "g":0, "b":0}` }
            }
          },
          {
            opcode: "HSV2hex",
            blockType: Scratch.BlockType.REPORTER,
            text: "hsv [COLOR] to hex",
            arguments: {
              COLOR: { type: Scratch.ArgumentType.STRING, defaultValue: `{"h":0,"s":1,"v":1,"a":255}` }
            }
          },
          {
            opcode: "DEC2hex",
            blockType: Scratch.BlockType.REPORTER,
            text: "decimal [COLOR] to hex",
            arguments: {
              COLOR: { type: Scratch.ArgumentType.NUMBER, defaultValue: 16711680 }
            }
          },
          { blockType: Scratch.BlockType.LABEL, text: "Gradients" },
          {
            opcode: "linearGradient",
            blockType: Scratch.BlockType.REPORTER,
            text: "linear gradient with colors [STRING] at angle [ANGLE]",
            arguments: {
              STRING: { type: Scratch.ArgumentType.STRING, defaultValue: "use-below-blocks" },
              ANGLE: { type: Scratch.ArgumentType.NUMBER, defaultValue: 90}
            }
          },
          {
            opcode: "radialGradient",
            blockType: Scratch.BlockType.REPORTER,
            text: "radial gradient with colors [STRING] at x [x] y [y]",
            arguments: {
              STRING: { type: Scratch.ArgumentType.STRING, defaultValue: "use-below-blocks" },
              x: { type: Scratch.ArgumentType.NUMBER, defaultValue: 0},
              y: { type: Scratch.ArgumentType.NUMBER, defaultValue: 0}
            }
          },
          {
            opcode: "conicGradient",
            blockType: Scratch.BlockType.REPORTER,
            text: "conic gradient with colors [STRING] at x [x] y [y]",
            arguments: {
              STRING: { type: Scratch.ArgumentType.STRING, defaultValue: "use-below-blocks" },
              x: { type: Scratch.ArgumentType.NUMBER, defaultValue: 0},
              y: { type: Scratch.ArgumentType.NUMBER, defaultValue: 0}
            }
          },
          {
            opcode: "maker1",
            blockType: Scratch.BlockType.REPORTER,
            text: "[COLOR], [STRING]",
            arguments: {
              STRING: { type: Scratch.ArgumentType.STRING, defaultValue: "hex-2" },
              COLOR: { type: Scratch.ArgumentType.COLOR, defaultValue: "#ff0000" }
            }
          },
          {
            opcode: "maker2",
            blockType: Scratch.BlockType.REPORTER,
            text: "[COLOR] at [PERCENT] %, [STRING]",
            arguments: {
              STRING: { type: Scratch.ArgumentType.STRING, defaultValue: "hex-2" },
              PERCENT: { type: Scratch.ArgumentType.NUMBER, defaultValue: 25 },
              COLOR: { type: Scratch.ArgumentType.COLOR, defaultValue: "#ff0000" }
            }
          },
          {
            opcode: "maker3",
            blockType: Scratch.BlockType.REPORTER,
            text: "[COLOR] at angle [PERCENT], [STRING]",
            arguments: {
              STRING: { type: Scratch.ArgumentType.STRING, defaultValue: "hex-2" },
              PERCENT: { type: Scratch.ArgumentType.NUMBER, defaultValue: 90 },
              COLOR: { type: Scratch.ArgumentType.COLOR, defaultValue: "#ff0000" }
            }
          },
        ],
        menus: {
          COLORS: { acceptReporters: true, items: ["hex", "rgb", "hsv", "decimal"] },
          COLCONV : ["rgb", "hsv", "decimal"],
          COLATTS : ["hue", "saturation", "brightness", "opacity"],
        }
      };
    }

    // Converters
    hex2RGBA(hex) {
      hex = hex.startsWith("#") ? hex.slice(1) : hex;
      let alpha = 255;
      if (hex.length === 8) alpha = parseInt(hex.slice(6, 8), 16);
      return {
        r: parseInt(hex.slice(0, 2), 16), g: parseInt(hex.slice(2, 4), 16), b: parseInt(hex.slice(4, 6), 16), a: alpha,
      };
    }

    RGBA2hex(rgb) {
      const alpha = rgb.a !== undefined ? Math.round(rgb.a).toString(16).padStart(2, "0") : "";
      return `#${(1 << 24 | rgb.r << 16 | rgb.g << 8 | rgb.b).toString(16).slice(1)}${alpha}`;
    }

    hex2HSV(hex) {
      const { r, g, b, a } = this.hex2RGBA(hex);
      const max = Math.max(r, g, b), min = Math.min(r, g, b), d = max - min, s = max === 0 ? 0 : d / max, v = max / 255;
      let h;
      if (d === 0) h = 0;
      else {
        if (max === r) h = ((g - b) / d + (g < b ? 6 : 0)) % 6;
        else if (max === g) h = ((b - r) / d + 2) % 6;
        else h = ((r - g) / d + 4) % 6;
        h *= 60;
      }
      return { h: Math.round(h), s, v, a };
    }

    hsv2hex(hsv) {
      const c = hsv.v * hsv.s;
      const x = c * (1 - Math.abs((hsv.h / 60) % 2 - 1));
      let rgb;
      if (hsv.h >= 0 && hsv.h < 60) rgb = [c, x, 0];
      else if (hsv.h >= 60 && hsv.h < 120) rgb = [x, c, 0];
      else if (hsv.h >= 120 && hsv.h < 180) rgb = [0, c, x];
      else if (hsv.h >= 180 && hsv.h < 240) rgb = [0, x, c];
      else if (hsv.h >= 240 && hsv.h < 300) rgb = [x, 0, c];
      else rgb = [c, 0, x];
      const [r, g, b] = rgb.map(val => Math.round((val + (hsv.v - c)) * 255));
      return this.RGBA2hex({ r, g, b });
    }

    hex2DEC(hex) {
      const rgb = this.hex2RGBA(hex);
      return (rgb.r << 16) + (rgb.g << 8) + rgb.b;
    }

    dec2Hex(dec) {
      if (dec < 0) dec += 0xFFFFFF + 1;
      let hex = Math.round(Number(dec)).toString(16);
      return `#${"000000".substr(0, 6 - hex.length)}${hex}`;
    }

    // Color blocks
    hexString(args) { return args.COLOR }

    convPen(args) { return Scratch.Cast.toString(args.COLOR).slice(0, 7) }

    hex2COL(args) {
      const value = this[args.COL === "rgb" ? "hex2RGBA" : args.COL === "rgb" ? "hex2HSV" : "hex2DEC"](args.COLOR);
      return JSON.stringify(value);
    }

    RGB2hex(args) {
      try {
        return this.RGBA2hex(JSON.parse(args.COLOR));
      } catch { return "#000000" }
    }

    HSV2hex(args) {
      try {
        return this.hsv2hex(JSON.parse(args.COLOR));
      } catch { return "#000000" }
    }

    DEC2hex(args) {
      return this.dec2Hex(Scratch.Cast.toNumber(args.COLOR));
    }

    randomHex(args) {
      const rngCom = () => Math.floor(Math.random() * 256);
      const hex = this.RGBA2hex({ r: rngCom(), g: rngCom(), b: rngCom(), a: rngCom() });
      switch (args.COLOR) {
        case "rgb": return JSON.stringify(this.hex2RGBA(hex));
        case "hsv": return JSON.stringify(this.hex2HSV(hex));
        case "decimal": return this.hex2DEC(hex);
        default: return hex;
      }
    }

    changeHexAtt(args) {
      const changeAMT = Scratch.Cast.toNumber(args.NUM);
      let color = Scratch.Cast.toString(args.COLOR);
      if (args.ATT === "opacity") {
        const rgbaColor = this.hex2RGBA(color);
        rgbaColor.a = Math.max(0, Math.min(255, ((changeAMT - 100)* -2.55)));
        color = this.RGBA2hex(rgbaColor);
      } else {
        const rgbaColor = this.hex2RGBA(color);
        const hsvColor = this.hex2HSV(color);
        if (args.ATT === "hue") {
          hsvColor.h = (hsvColor.h + changeAMT) % 360;
          hsvColor.h = hsvColor.h < 0 ? 360 + hsvColor.h : hsvColor.h;
        } else if (args.ATT === "saturation") {
          hsvColor.s = Math.max(0, Math.min(1, hsvColor.s + (changeAMT - 100) / 100));
        } else if (args.ATT === "brightness") {
          hsvColor.v = Math.max(0, Math.min(1, hsvColor.v + (changeAMT - 100) / 100));
        }
        color = this.hsv2hex(hsvColor);
      }
      return color;
    }

    mergeHex(args) {
      const rgb0 = this.hex2RGBA(args.COLOR);
      const rgb1 = this.hex2RGBA(args.COLOR2);
      const off = [Math.abs(args.NUM / 100), 1 - Math.abs(args.NUM / 100)];
      return this.RGBA2hex({
        r: (off[0] * rgb0.r) + (off[1] * rgb1.r),
        g: (off[0] * rgb0.g) + (off[1] * rgb1.g),
        b: (off[0] * rgb0.b) + (off[1] * rgb1.b)
      });
    }

    invertHex(args) {
      const rgb = this.hex2RGBA(args.COLOR);
      rgb.r = 255 - rgb.r;
      rgb.g = 255 - rgb.g;
      rgb.b = 255 - rgb.b;
      return this.RGBA2hex(rgb);
    }

    sameColor(args) {
      const srcRGB = this.hex2RGBA(args.COLOR);
      const matRGB = this.hex2RGBA(args.COLOR2);
      const soft = Scratch.Cast.toNumber(args.NUM) * 10;
      const inRange = (val1, val2) => val1 >= val2 - soft && val1 <= val2 + soft;
      return inRange(srcRGB.r, matRGB.r) && inRange(srcRGB.g, matRGB.g) && inRange(srcRGB.b, matRGB.b)
    }

    // Gradient blocks
    linearGradient(args) { return `linear-gradient(${args.ANGLE - 90}deg,${args.STRING})` }

    radialGradient(args) { return `radial-gradient(circle at ${args.x}% ${args.y * -1}%,${args.STRING})` }

    conicGradient(args) { return `conic-gradient(at ${args.x}% ${args.y * -1}%,${args.STRING})` }

    maker1(args) { return `${args.COLOR}${args.STRING ? `,${args.STRING}` : ""}` }

    maker2(args) { return `${args.COLOR} ${args.PERCENT}%${args.STRING ? `,${args.STRING}` : ""}` }

    maker3(args) { return `${args.COLOR} ${args.PERCENT - 90}deg${args.STRING ? `,${args.STRING}` : ""}` }
  }

  function add2Body() {
    var grad1 = document.createElement("div");
    grad1.innerHTML = `<svg><defs>
      <linearGradient x1="240" y1="0" x2="240" y2="100" gradientUnits="userSpaceOnUse" id="SPcolorMaster-GRAD1">
      <stop offset="0" stop-color="#002eff"/><stop offset="0.5" stop-color="#b200ff"/></linearGradient>
      </defs></svg>`;
    var grad2 = document.createElement("div");
    grad2.innerHTML = `<svg><defs>
      <linearGradient x1="240" y1="0" x2="240" y2="100" gradientUnits="userSpaceOnUse" id="SPcolorMaster-GRAD2">
      <stop offset="0" stop-color="#b200ff"/><stop offset="0.5" stop-color="#002eff"/></linearGradient>
      </defs></svg>`;
    document.body.append(grad1, grad2);
  }
  if (Scratch.gui) Scratch.gui.getBlockly().then((SB) => {
    add2Body();
    if (!SB?.SPgradients?.patched) { // Gradient Patch by 0znzw & SharkPool
      SB.SPgradients = {gradientUrls: {}, patched: false};
      const BSP = SB.BlockSvg.prototype, BSPR = BSP.render;
      BSP.render = function(...args) {
        const res = BSPR.apply(this, args);
        let category;
        if (this?.svgPath_ && this?.category_ && (category = this.type.slice(0, this.type.indexOf("_"))) && ScratchBlocks.SPgradients.gradientUrls[category]) {
          const urls = SB.SPgradients.gradientUrls[category];
          if (urls) this.svgPath_.setAttribute("fill", urls[0]);
        }
        return res;
      }
      SB.SPgradients.patched = true;
    }
    SB.SPgradients.gradientUrls["SPcolorMaster"] = ["url(#SPcolorMaster-GRAD1)", "url(#SPcolorMaster-GRAD2)"];
  });

  Scratch.extensions.register(new SPcolorMaster);
})(Scratch);
